    is a collection of agricultural-related data from official statistical publications
    of the People's Republic of China. Analysts and policy professionals around the
    world need information about the rapidly changing Chinese economy, but statistics
    are often published only in China and sometimes only in Chinese-language publications.
    This product assembles a wide variety of data items covering agricultural production,
